<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Title</title>
</head>
<body>
<script>
  /**
   * @param {number[]} nums
   * @return {number}
   */
  var f = removeDuplicates = function(nums) {
    for (let i = 0; i < nums.length; i++) {
      const index = nums.indexOf(nums[i]);
      if (index !== i) {
        nums.splice(i, 1);
        i--;
      }
    }
    return nums.length;
  };
</script>
</body>
</html>
